import { API, wrapPromise } from 'utils/api';

function fetchBaseProfile({ userId, jwt }) {
	return API.get(`web/profile/${userId}`, {
		headers: {
			'x-access-token': jwt,
		},
	});
}

// function fetchTopbanner() {
// 	return API.get('web/jobsFeed/advertisments');
// }

export const fetchUserProfile = ({ userId, jwt }) =>
	// const baseProfile = fetchBaseProfile({ userId, jwt });
	wrapPromise(
		API.get(`web/profile/${userId}`, {
			headers: {
				'x-access-token': jwt,
			},
		}),
	);
